import React from "react"

const Indexmenu = ({ link, alt, heading }) => {
  return (
    <div
      className="indexmenu"
      alt={alt}
      style={{ backgroundImage: { link }, maxWidth: "100%", maxHeight: "100%" }}
    >

      <h2>{heading}</h2>
    </div>
  )
}
export default Indexmenu
